INSERT INTO `faqs` VALUES(1, 'SMM panels - what are they?', 0, 'active', '<p>An SMM panel is an online shop that you can visit to purchase SMM services at great prices.</p>', '2021-11-04 07:17:36', '2021-11-14 12:47:31');
INSERT INTO `faqs` VALUES(2, 'What SMM services can I find on this panel?', 0, 'active', '<p>We sell different types of SMM services — likes, followers, views, etc.</p>', '2021-11-04 07:18:11', '2021-11-04 07:18:11');
INSERT INTO `faqs` VALUES(3, 'Are SMM services on your panel safe to buy?', 0, 'active', '<p>Sure! Your accounts won\'t get banned.</p>', '2021-11-04 07:19:46', '2021-11-04 07:19:46');
INSERT INTO `faqs` VALUES(4, 'What is the start time & speed after placing an order?', 0, 'active', '<p>Every service is different. Whenever you select a service from the drop-down menu, you will see a Description box with all the specifications for that particular service</p>', '2021-11-04 07:21:10', '2021-11-04 07:21:10');
INSERT INTO `faqs` VALUES(5, 'How do I place an order?', 0, 'active', '<p><strong>Step 1</strong>: &nbsp;Select the Social Media platform you want to grow.</p><p><strong>Step 2</strong>: Carefully read details for every service before placing an order.</p><p><strong>Step 3</strong>: &nbsp;Enter the username or page link.</p><p><strong>Step 4</strong>: It will shows your order cost.</p><p>Press Submit and enjoy your order!</p>', '2021-11-04 07:23:17', '2021-11-04 07:30:17');
