INSERT INTO `language_values` VALUES(16902, '<p>every service is different. whenever you select a service from the drop-down menu, you will see a description box with all the specifications for that particular service</p>', '<p> تختلف كل خدمة عن غيرها. عندما تحدد خدمة من القائمة المنسدلة ، فسترى مربع الوصف مع جميع المواصفات لهذه الخدمة المعينة </ p>', 2, NULL, NULL);
INSERT INTO `language_values` VALUES(16899, 'our services can help you make your account more effective.', 'يمكن أن تساعدك خدماتنا في جعل حسابك أكثر فعالية.', 2, NULL, NULL);
INSERT INTO `language_values` VALUES(16897, 'awaiting', 'تنتظر', 2, NULL, NULL);
INSERT INTO `language_values` VALUES(16900, '<p><strong>step 1</strong>: &nbsp;select the social media platform you want to grow.</p><p><strong>step 2</strong>: carefully read details for every service before placing an order.</p><p><strong>step 3</strong>: &nbsp;enter the username or page link.</p><p><strong>step 4</strong>: it will shows your order cost.</p><p>press submit and enjoy your order!</p>', '<p> <strong> الخطوة الأولى </ strong>:  حدد نظام الوسائط الاجتماعية الذي تريد تطويره. </ p> <p> <strong> الخطوة 2 </strong>: اقرأ التفاصيل بعناية لكل خدمة قبل تقديمها طلب. </ p> <p> <strong> الخطوة الثالثة </ strong>: أدخل اسم المستخدم أو رابط الصفحة. </ p> <p> <strong> الخطوة 4 </strong>: سيعرض تكلفة الطلب. </ p> <p> اضغط على إرسال واستمتع بطلبك! </ p>', 2, NULL, NULL);
