INSERT INTO `settings` VALUES(8, 'new_user_welcome_email_tpl_active', 'on', 'email', '2021-10-25 11:46:42', '2021-10-25 11:46:42');
INSERT INTO `settings` VALUES(9, 'new_user_welcome_email_tpl_subject', '{{website_name}} - Getting Started with Our Service!', 'email', '2021-10-25 11:46:42', '2021-10-26 07:14:21');
INSERT INTO `settings` VALUES(10, 'new_user_welcome_email_tpl', '<p><strong>Welcome to {{website_name}}!&nbsp;</strong></p><p>Hello <strong>{{firstname}}</strong>!</p><p>Congratulations!&nbsp;<br>You have successfully signed up for our service - {{website_name}}&nbsp;with follow data:</p><ul><li>Firstname: {{firstname}}</li><li>Lastname: lastname</li><li>Email: {{email}}</li><li>Username: {{username}}</li></ul><p>We want to exceed your expectations, so please do not&nbsp;hesitate to reach out at any time if you have any questions or concerns. We look to working with you.</p><p>Best Regards,</p>', 'email', '2021-10-25 11:46:42', '2021-10-26 07:14:21');
INSERT INTO `settings` VALUES(11, 'email_verification_tpl_active', 'on', 'email', '2021-10-25 11:46:42', '2021-10-30 06:50:41');
INSERT INTO `settings` VALUES(12, 'email_verification_tpl_subject', '{{website_name}} - Account verification', 'email', '2021-10-25 11:46:42', '2021-10-30 06:50:41');
INSERT INTO `settings` VALUES(13, 'email_verification_tpl', '<p>Hello <strong>{{firstname}}</strong>!</p><p>Thank you for joining! We\'re glad to have you as community member, and we\'re stocked for you to start exploring our service. &nbsp;If you don\'t verify your address, you won\'t be able to create a&nbsp;User Account.</p><p>All you need to do is activate your account&nbsp;by click this link:&nbsp; <strong>{{activation_link}}</strong>&nbsp;</p><p>Thanks and Best Regards!</p>', 'email', '2021-10-25 11:46:42', '2021-10-30 06:50:41');
INSERT INTO `settings` VALUES(14, 'payment_notification_tpl_active', 'on', 'email', '2021-10-25 11:46:42', '2021-10-26 12:51:44');
INSERT INTO `settings` VALUES(15, 'payment_notification_tpl_subject', '{{website_name}} - an amount has been deposited into your account', 'email', '2021-10-25 11:46:42', '2021-10-26 13:06:53');
INSERT INTO `settings` VALUES(16, 'payment_notification_tpl', '<p>Hello <strong>{{firstname}},</strong></p><p>An amount of <strong>{{amount}} {{currency}}</strong> via&nbsp; <strong>{{method_name}}</strong> has been deposited into your account.</p><p>-------------------------------</p><p><strong>Details of your Deposit :</strong></p><p>Amount : {{amount}} {{currency}}</p><p>Paid via :&nbsp; {{method_name}}</p><p>Transaction Number : {{transaction_number}}</p><p>Your current Balance is <strong>{{balance}} {{currency}}</strong></p><p>&nbsp;</p>', 'email', '2021-10-25 11:46:42', '2021-10-26 13:27:41');
INSERT INTO `settings` VALUES(17, 'order_status_tpl_active', 'on', 'email', '2021-10-25 11:46:42', '2021-11-22 11:19:31');
INSERT INTO `settings` VALUES(18, 'order_status_tpl_subject', '{{website_name}} - Your order status', 'email', '2021-10-25 11:46:42', '2021-10-27 07:37:07');
INSERT INTO `settings` VALUES(19, 'order_status_tpl', '<p>Hello <strong>{{firstname}},</strong></p><p>Your order for <strong>{{service_name}}</strong> is now <strong>{{status}}</strong> .</p><p>-------------------------------</p><p><strong>Order Details :</strong></p><p>Order ID : {{order_ID}}</p><p>Service Name : {{service_name}}&nbsp;</p><p>Service Category : {{service_category}}</p><p>Price : &nbsp;{{price}} {{currency}}</p><p>Your Balance : &nbsp;{{balance}} {{currency}}</p>', 'email', '2021-10-25 11:46:42', '2021-10-27 07:21:34');
INSERT INTO `settings` VALUES(20, 'website_logo', 'logo.png', 'apparence', '2021-10-25 11:58:25', '2021-10-25 11:58:25');
INSERT INTO `settings` VALUES(23, 'password_recovery_tpl_active', 'on', 'email', '2021-10-30 14:07:16', '2021-10-30 14:07:16');
INSERT INTO `settings` VALUES(24, 'password_recovery_tpl_subject', '{{website_name}} - Reset Password Notification', 'email', '2021-10-30 14:07:16', '2021-10-30 17:21:55');
INSERT INTO `settings` VALUES(25, 'password_recovery_tpl', '<p>Hi<strong> {{firstname}}</strong>! ,</p><p>You are receiving this email because we received a password reset request for your account.</p><p><strong>{{recovery_password_link}}</strong></p><p>This password reset link will expire in 60 minutes.</p><p>If you did not request a password reset, no further action is required.</p><p>Regards,</p><p><strong>{{website_name}}</strong></p>', 'email', '2021-10-30 14:07:16', '2021-10-30 17:22:23');
